package cofu

import (
	"testing"
	"os"
	"io/ioutil"
	"github.com/kohkimakimoto/loglv"
)



var (
	Content01 = `hogehoge`
	Content02 = ``
)


func TestResource_ShowContentDiff(t *testing.T) {
	app := NewApp()
	defer app.Close()
	if err := app.Init(); err != nil {
		t.Error(err)
	}
	loglv.SetLevelByString("debug")

	resourceType := &ResourceType{
		Name: "test",
	}

	tmpFile01, err := createTempfileWithContent(Content01)
	if err != nil {
		t.Errorf("should not raise error: %v", err)
	}
	defer func() {
		tmpFile01.Close()
		os.Remove(tmpFile01.Name())
	}()


	tmpFile02, err := createTempfileWithContent(Content02)
	if err != nil {
		t.Errorf("should not raise error: %v", err)
	}
	defer func() {
		tmpFile02.Close()
		os.Remove(tmpFile02.Name())
	}()

	r := NewResource("test001", resourceType, app)
	r.ShowContentDiff(tmpFile01.Name(), tmpFile02.Name())
}

func createTempfileWithContent(c string) (*os.File, error) {
	tempFile, err := ioutil.TempFile("", "")
	if err != nil {
		return nil, err
	}
	if err = ioutil.WriteFile(tempFile.Name(), []byte(c), 0644); err != nil {
		return nil, err
	}

	return tempFile, nil
}



